import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import { Navigation, Footer, Home, Contact, SignUp, SignIn, Doctprofile } from "./components";

class App extends React.Component {
  constructor() {
    super();
  }

  RouterHome() {
    if (true) {
      return (
        <Route exact path="/" element={<Home />} />
      )
    }
  }

  RouterSignUp() {
    if (true) {
      return (
        <Route path="/signup" element={<SignUp />} />
      )
    }
  }
  RouterSignIn() {
    if (true) {
      return (
        <Route path="/signin" element={<SignIn />} />
      )
    }
  }
  RouterContact() {
    if (true) {
      return (
        <Route path="/signin" element={<Contact />} />
      )
    }
  }
  render() {
    return (
      <div className="App">
        <Router>
          <Navigation />
          <Routes>
            {this.RouterHome()}
            {this.RouterSignUp()}
            <Route path="/doctorNotAPP" element={<Doctprofile />} />
            <Route path="/contact" element={<Contact />} />
            <Route path="/signin" element={<SignIn />} />
          </Routes>
        </Router>
      </div>
    );
  }
}
export default App;
